Verenigde Staten / Duitsland
Actie
110 minuten

goed

met James McAvoy, Morgan Freeman en Angelina Jolie

Wanneer de baas van een bende huurmoordenaars contact legt met Wesley Allan Gibson (McAvoy), een depressieve kantoorbediende, en hem vertelt dat zijn vader een huurmoordenaar was die onlangs vermoord werd, besluit Wesley zijn leven in eigen handen te nemen en ook een professionele moordenaar te worden. Al snel blijkt dat hij een waar talent is en hij wordt toegelaten tot het geheime gezelschap, waar hij besluit wraak te nemen om zijn vaders dood. Wesley raakt binnen de kortste keren helemaal in de macht van de clan en van Sloan, de baas (Freeman). Samen met zijn 'collega' Fox (Jolie) gaat hij op zoek naar de moordenaar van zijn vader.:
